{"time": "16:55 10/03/2020", "content": "THÔNG TIN CA BỆNH 34 (BN34): Một phụ nữ 51 tuổi, quốc tịch Việt Nam, được xác định mắc bệnh COVID-19 tại Việt Nam. Theo thông tin dữ liệu y tế, ngày 22/2/2020 bệnh nhân bay từ Việt Nam sang New York (Mỹ), quá cảnh tại sân bay Incheon (Hàn Quốc). Đến ngày 29/2/2020, bệnh nhân bay từ Washington D.C (Mỹ) về Việt Nam, quá cảnh tại sân bay quốc tế Doha (Qatar) và sáng ngày 02/3/2020 nhập cảnh vào Việt Nam tại cửa khẩu Cảng Hàng không Quốc tế Tân Sơn Nhất. Sáng 9/3/2020, bệnh nhân nhập viện tại Bệnh viện Đa khoa tỉnh Bình Thuận và được điều trị cách ly tại đây.", "link": "https://ncov.moh.gov.vn/web/guest/dong-thoi-gian"}
